import React, { Component } from 'react';
import './app-header.css';

export default class AppHeader extends Component {

    render() {
        return (
            <div className="app-header">
                <menu>
                    <nav>
                        <ul>
                           <li className="item-menu"></li> 
                        </ul>
                        
                    </nav>
                </menu>
                <h1>Hello world</h1>
            </div>   
        );
    };
};
